--64Bit to Png Decoder
local b='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'
local function dec(data)
    data = string.gsub(data, '[^'..b..'=]', '')
    return (data:gsub('.', function(x)
        if (x == '=') then return '' end
        local r,f='',(b:find(x)-1)
        for i=6,1,-1 do r=r..(f%2^i-f%2^(i-1)>0 and '1' or '0') end
        return r;
    end):gsub('%d%d%d?%d?%d?%d?%d?%d?', function(x)
        if (#x ~= 8) then return '' end
        local c=0
        for i=1,8 do c=c+(x:sub(i,i)=='1' and 2^(8-i) or 0) end
        return string.char(c)
    end))
end

-- GUI
local ref = gui.Tab(gui.Reference("Misc"), "ReactionSnipe.settings", "ReactionSnipe")
local MidDoors_Group = gui.Groupbox(ref, "Settings for ReactionSnipe", 15, 15, 603);
local MidDoors_Act = gui.Checkbox( MidDoors_Group, "lua_checkbox", "Enable",true );
local MidDoors_Speed = gui.Slider( MidDoors_Group,"lua_slider" ,"Speed", 2,1,6);

-- Image parameters
local fgdat = dec(b64_fg)
local fgrgba, fgw, fgh = common.DecodePNG(fgdat)
local fg = draw.CreateTexture(fgrgba, fgw, fgh)

local bgdat = dec(b64_bg)
local bgrgba, bgw, bgh = common.DecodePNG(bgdat)
local bg = draw.CreateTexture(bgrgba, bgw, bgh)

local ctdat = dec(b64_ct)
local ctrgba, ctw, cth = common.DecodePNG(ctdat)
local ct = draw.CreateTexture(ctrgba, ctw, cth)
local ct_x_offset, ct_y_offset = 215,200;
local ct_jumping;

local sbdat = dec(b64_sb)
local sbrgba, sbw, sbh = common.DecodePNG(sbdat)
local sb = draw.CreateTexture(sbrgba, sbw, sbh)

--Game Variables
local windowx, windowy, windowsizex, windowsizey = 1900, 500, fgw, fgh;
local dragging_offset_x, dragging_offset_x, prevmousex, prevmousey, mx, my,prevM, dragM = 0, 0, 0, 0, 0, 0, false, false;
local TicksPassed = 0;
local RandomTick = 0;
local playing = false;
local endMessage = nil;
local Font = draw.CreateFont( "Tahoma", 25 );

--Function that checks if the mouse hovers over an object
local function mouseOverObject(x,y,x1,y1,x2,y2)
	if x >= x1 and x <= x2 then	
		if y >= y1 and y <= y2 then	
			return true	
		else
			return false		
		end		
	else
		return false	
	end
end

--Handling the mouse Drag
local function dragHandler()
    local mouse_x, mouse_y = input.GetMousePos();
	windowx = mouse_x - dragging_offset_x;
	windowy = mouse_y - dragging_offset_y;
	return;
end

--Iniate the GameStart
local function startGame()
	TicksPassed=0;
	RandomTick=math.random(240, 900)
	ct_jumping=true;
	ct_x_offset, ct_y_offset = 215,200;
	playing=true;
end

--Checks if Game Ends
local function EndGameCheck()
	if (TicksPassed>RandomTick) then
		playing=false;
		endMessage=(TicksPassed-RandomTick)/60;
	elseif (TicksPassed<RandomTick) then	
		playing=false;
		endMessage=0;
	end
end

--Draw Functions
local function Game()
	TicksPassed = TicksPassed + 1;
	if (ct_jumping and TicksPassed > RandomTick) then
		if (ct_x_offset<100) then
			ct_jumping=false;
			playing=false;
			endMessage=0;
		else
			ct_x_offset = ct_x_offset - MidDoors_Speed:GetValue();
		end
	end
end

local function DrawFrame()
	if (MidDoors_Act:GetValue()) then
		draw.SetTexture( bg );
		draw.FilledRect(windowx, windowy, windowx + windowsizex, windowy + windowsizey)   
		draw.SetTexture( ct );
		draw.FilledRect(windowx + ct_x_offset, windowy + ct_y_offset, windowx + ctw +ct_x_offset, windowy + cth + ct_y_offset)	
		draw.SetTexture( fg );
		draw.FilledRect(windowx, windowy, windowx + windowsizex, windowy + windowsizey);
		if (playing) then
			Game();
		else
			draw.SetTexture( sb );
			draw.FilledRect(windowx, windowy + 200, windowx + sbw, windowy + sbh + 200);
			if (endMessage==0) then
				draw.SetFont( Font );
				draw.Text(windowx + 15, windowy + 440, "You missed the enemy!" ) ;
				draw.Text( windowx + 15, windowy + 460, "Press Space to start." ) ;
			elseif ( endMessage==nil ) then
				draw.SetFont( Font );
				draw.Text( windowx + 15, windowy + 460, "Press Space to start." ) ;
			else
				draw.SetFont( Font );
				draw.Text( windowx + 15, windowy + 420, "Good job, you hit!" ) ;
				draw.Text( windowx + 15, windowy + 440, "Reaction: " .. endMessage  .. "sec" ) ;
				draw.Text( windowx + 15, windowy + 460, "Press Space to start." ) ;
			end
			
			if (input.IsButtonPressed(32)) then
				startGame();
			end
		end
		
		

		local mousedown = input.IsButtonDown(1);
		local mouse_x, mouse_y = input.GetMousePos();

		if (mousedown == true) then
			if (dragM) then
				dragHandler();
			elseif (not prevM and mouseOverObject(mouse_x, mouse_y, windowx, windowy, windowx + 60, windowy+ 80)) then --Object = MoveButton
				dragM=true;
				dragging_offset_x = mouse_x - windowx;
				dragging_offset_y = mouse_y - windowy;
				dragHandler();
			elseif (playing and mouseOverObject(mouse_x,mouse_y, windowx, windowy + 80, windowx + 400, windowy + 400)) then --Object = Game
				EndGameCheck()
			end
			prevM=true;
		else
			prevM = false;
			dragM = false;
		end


		
	end	
end
callbacks.Register("Draw", "DrawFrame", DrawFrame );





